import React, { Component } from 'react';
import Login from './components/login/Login';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router, BrowserRouter as Link, Route} from "react-router-dom";
import Register from './components/register/Register';


class App extends Component {
  render() {
    return (
      <Router>
        <div className="App">
          <div className="App">
            <Login />
            
            <Link path="/register">To</Link>
            <Switch>
            {routes.map((route, i) => (
              <Route key={i} path={route.path} render={props => (
                <route.component {...props} routes={route.routes} />
              )} />
            ))}
            </Switch>
          </div>
        </div>
      </Router>
    );
  }
}

const routes = [
  {
    path: "/register",
    component: Register
  },
  {
    path: "/Login",
    component: Login
  }
];



export default App;
